import React from 'react';
import Carouselitem from '../../../General/MyCarousel/carouselitem.js';
import Carouselindicator from '../../../General/MyCarousel/carouselindicator.js';
import Carousel from '../../../General/MyCarousel/carousel.js';
import DiscountsJson from './discountsJson.js';

class Discounts extends React.Component{
  render() {
    return (
      <Carousel
        id="switzerland"
        class="carousel slide"
        data="carousel"
        href="#switzerland"
        carouselitems ={DiscountsJson}
        />
    )
  }
}
export default Discounts
